import React, { Component } from "react";
import Input from "./input.jsx";

const AliasedInput = ({ title, id, aliases, handleTitleChange, handleAliasChange }) => {
    // console.log("id", id)
    return (
    <div>
      <Input
        name="title"
        id={id}
        //   label={this.state.titleLable}
        value={title}
        onChange={handleTitleChange}
        sizeClass={"form-control-lg"}
      />
      <Input
        label="Aliases"
        id={id}
        value={aliases.join(",")}
        onChange={handleAliasChange}
        sizeClass={"form-control-sm ml-5"}
      />
    </div>
  );
};

export default AliasedInput;
